public class Day11B {
    public static void main(String[] args) {
        int i = 0;
        
        while (i < 10) {
            System.out.println("while: "+i);
            i++;
        }
        
        i = 50;
        while (i >= 7) {            
            System.out.println("b: "+i);
            i -= 3;
        }
        
        i = 0;
        do {
            System.out.println("do While: " + i);
            i++;
        } while (i < 10);
    }
}

