public class Day11C {
    public static void main(String[] args) {
        int ref = 9;
        int j;
        int k = ref;
        
        while (k > 0) {
            j = ref;
            while (j > 0) {
                System.out.print(j);
                j--;
            }
            System.out.println(k);
            k--;
        }

        System.out.println("----------------------------");
        
        k = ref;
        while (k > 0) {
            j = ref;
            while (j > 0) {
                if (k == 1 || k == ref) {
                    System.out.print("&");
                } else {
                    if (j == 1 || j == ref) {
                        System.out.print("&");
                    } else {
                        System.out.print(" ");
                    }
                }
                j--;
            }
            System.out.println("");
            k--;
        }
    }
}

